import footerDevKg from '../../Assets/img/devKg logo.svg'

const Footer = () => {
	return (
		<div id='footer'>
			<div className='footer'>
				<div className='container'>
					<img className='footerDevKg' src={footerDevKg} alt='img' />
					<div className='footer-text'>
						<h1>
							Сообщество разработчиков DevKG Мы — сообщество разработчиков
							Кыргызстана. Данный проект поддерживается и <br />администрируется
							членами нашего сообщества.
						</h1>
					</div>
				</div>
			</div>
		</div>
	)
};

export default Footer;
